import 'isomorphic-fetch';

class Movie extends Component {
    constructor(props) {
        super(props);
        this.state = { 
            show:true,
         }
    }



    render() { 

        async function loadImage(url) {
            const img = await fetch(url)
            //return <img src={poster.blob}></img>
            return img

        }
        const poster = loadImage(this.props.posterurl)

        return (
            <div>
                Berk
                {poster}
            </div>
        )
    }
}

export default Movie;
